description:
Charismagic Vol. 1

English | CBR | 7 Issues Collected

Genre: Action/Adventure, Fantasy, Supernatural/Occult

Written by Written Vince Hernandez
Art by Khary Randolph

Collects isuues #0-6. Everything you thought you knew about magic will... Vanish. Journey into a world where the lines between magic and reality are blurred... And where one man will soon find himself as the last remaining hope for all mankind. In Las Vegas, luck is everything. For Sin City's leading 'entertainer,' Hank the Magnificent, his luck as Vegas' most illustrious and famous magician is about to run out! When the powers of an ancient magic once imprisoned in another realm spring forth into our reality searching for revenge at all costs, Hank soon finds himself at the center of an undying war between the forces of truth and a devastating plague of growing evil-and his hopes for survival are slim at best! Alongside Sudana, a Druid of visionary descent and his pet cat Sparkles, Hank painstakingly learns the price of saving the world could very well be their lives. The odds are certainly not in their favor! Creatures of magic and myth, wizards and sorcerers, druids, witches, and beasts of legend fill the pages of Aspen's all-new action-adventure series!

